import React, { useState, useEffect } from 'react'
import {useAudio} from 'react-use';

const BackgroundEffect = React.memo((props) => {
  var [audio, state, controls, ref] = useAudio({
    src: props.config.url,
    autoPlay: true,
  });

  return (
    <div>{audio}</div>
  );
});

export default BackgroundEffect;
